    "src/lib/string.js": "'use strict';var $builtinmodule=function(h){var a={};a.ascii_lowercase=new Sk.builtin.str(\"abcdefghijklmnopqrstuvwxyz\");a.ascii_uppercase=new Sk.builtin.str(\"ABCDEFGHIJKLMNOPQRSTUVWXYZ\");a.ascii_letters=new Sk.builtin.str(a.ascii_lowercase.v+a.ascii_uppercase.v);a.lowercase=new Sk.builtin.str(\"abcdefghijklmnopqrstuvwxyz\");a.uppercase=new Sk.builtin.str(\"ABCDEFGHIJKLMNOPQRSTUVWXYZ\");a.letters=new Sk.builtin.str(a.lowercase.v+a.uppercase.v);a.digits=new Sk.builtin.str(\"0123456789\");a.hexdigits=new Sk.builtin.str(\"0123456789abcdefABCDEF\");\na.octdigits=new Sk.builtin.str(\"01234567\");a.punctuation=new Sk.builtin.str(\"!\\\"#$%&'()*+,-./:;<=>?@[\\\\]^_`{|}~\");a.whitespace=new Sk.builtin.str(\"\\t\\n\\x0B\\f\\r \");a.printable=new Sk.builtin.str(a.digits.v+a.letters.v+a.punctuation.v+\" \\t\\n\\r\\x0B\\f\");a.split=new Sk.builtin.func(function(...a){return Sk.misceval.callsimArray(Sk.builtin.str.prototype.split,a)});a.capitalize=new Sk.builtin.func(function(a){return Sk.misceval.callsimArray(Sk.builtin.str.prototype.capitalize,[a])});a.join=new Sk.builtin.func(function(a,\nb){void 0===b&&(b=new Sk.builtin.str(\" \"));return Sk.misceval.callsimArray(Sk.builtin.str.prototype.join,[b,a])});a.capwords=new Sk.builtin.func(function(d,b){Sk.builtin.pyCheckArgsLen(\"capwords\",arguments.length,1,2);if(!Sk.builtin.checkString(d))throw new Sk.builtin.TypeError(\"s must be a string\");void 0===b&&(b=new Sk.builtin.str(\" \"));if(!Sk.builtin.checkString(b))throw new Sk.builtin.TypeError(\"sep must be a string\");for(var e=Sk.misceval.callsimArray(a.split,[d,b]).v,f=[],c=0;c<e.length;c++){var g=\nSk.misceval.callsimArray(a.capitalize,[e[c]]);f.push(g)}return Sk.misceval.callsimArray(a.join,[new Sk.builtin.list(f),b])});return a};\n",
